import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link, Navigate } from 'react-router-dom';
import Home from './components/Home';
import CompanyList from './components/CompanyList';
import CompanyDetail from './components/CompanyDetail';
import JobList from './components/JobList';
import JobDetail from './components/JobDetail';
import LoginForm from './components/LoginForm';
import SignupForm from './components/SignupForm';
import Profile from './components/Profile';
import JoblyApi from './api';
import { getToken, setToken } from './components/localStorage'; // Import localStorage utility
import ProtectedRoute from './components/ProtectedRoute'; // Import ProtectedRoute

const App = () => {
  const [currentUser, setCurrentUser] = useState(null);
  const [token, setTokenState] = useState(getToken()); // Initialize token from localStorage

  useEffect(() => {
    const loadUser = async () => {
      if (token) {
        const userData = await JoblyApi.getUserProfile(currentUser.username); // Fetch user data
        setCurrentUser(userData);
      }
    };
    loadUser();
  }, [token]);

  const login = async (username, password) => {
    const { token } = await JoblyApi.login(username, password);
    setTokenState(token);
    setToken(token); // Store token in localStorage
    JoblyApi.token = token; // Store token in API class
    setCurrentUser({ username }); // Set current user
  };

  const signup = async (username, password) => {
    const { token } = await JoblyApi.signup(username, password);
    setTokenState(token);
    setToken(token); // Store token in localStorage
    JoblyApi.token = token; // Store token in API class
    setCurrentUser({ username }); // Set current user
  };

  const logout = () => {
    setTokenState(null);
    setCurrentUser(null);
    setToken(null); // Clear token from localStorage
    JoblyApi.token = null; // Clear token in API class
  };

  return (
    <Router>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/companies">Companies</Link></li>
          <li><Link to="/jobs">Jobs</Link></li>
          {currentUser ? (
            <>
              <li>{currentUser.username}</li>
              <li><button onClick={logout}>Log Out</button></li>
            </>
          ) : (
            <>
              <li><Link to="/login">Login</Link></li>
              <li><Link to="/signup">Sign Up</Link></li>
            </>
          )}
        </ul>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/companies" element={<CompanyList />} />
        <Route path="/companies/:id" element={<CompanyDetail />} />
        <Route path="/jobs" element={<JobList />} />
        <Route path="/jobs/:id" element={<JobDetail />} />
        <Route path="/login" element={<LoginForm />} />
        <Route path="/signup" element={<SignupForm />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/protected" element={<ProtectedRoute />} />
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
};

export default App;
